  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:04.468317\",\n\t\"name\": \"amchitka-beach-surveys-1978-1980\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Surveys of 16 beaches on Amchitka Island
  began 28 October 1978 as part of Alaska Beached Bird Survey. The purpose of the
  surveys is to provide baseline data on natural patterns of mortality of birds and
  marine mammals. This data could be used in the future to determine the magnitude
  of the effects of natural or unnatural disasters on wildlife population. Except
  for a three month period from September through November 1978, surveys were conducted
  on a regular basis until shortly before Amchitkia was closed as a year round field
  station in October 1980. Total number of dead birds found was 33, with 39% being
  bald eagles, 18% unidentifiable, and the remaining 43% divided between 12 species.
  Total number of dead mammals was 96 with sea otters making up 79% of that number.\",\n\t\"license_title\":
